import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import PlayerPicksPage from "./components/PlayerPicksPage";
import AdminUploadPage from "./components/AdminUploadPage";
import AdminWinnersPage from "./components/AdminWinnersPage";
import ViewPicksPage from "./components/ViewPicksPage";
import ResultsPage from "./components/ResultsPage";
import PrintableGamesPage from "./components/PrintableGamesPage";
import AdminPicksPage from "./components/AdminPicksPage";
import WeekSelector from "./components/WeekSelector";
// Add or remove imports as your project evolves

function App() {
  return (
    <Router>
      <div className="p-4">
        <Routes>
          <Route path="/picks/week/:weekNumber" element={<PlayerPicksPage />} />
          <Route path="/admin/upload" element={<AdminUploadPage />} />
          <Route path="/admin/winners" element={<AdminWinnersPage />} />
          <Route path="/admin/picks" element={<AdminPicksPage />} />
          <Route path="/print/week/:weekNumber" element={<PrintableGamesPage />} />
          <Route path="/viewpicks/:weekNumber" element={<ViewPicksPage />} />
          <Route path="/results/:weekNumber" element={<ResultsPage />} />
          {/* Optional: Add a home or default route */}
          {/* <Route path="/" element={<HomePage />} /> */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
